import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div className='App'>
      <form action="">
        <span class="text-center">Welcome to Valgrind</span>
        <div class="input-container">
          <input type="email" required="required" placeholder="User@gmail.com" />
          <label>User:
          </label>
        </div>
        <div class="input-container">
          <input type="password" required="required" placeholder="************" />
          <label>Password:</label>
        </div>
        <div class="btn-toolbar text-bottom">
          <Button variant= "btn btn-color#green position-relative">Register</Button>{''}
        </div>
      </form>
    </div >
  );
}

export default App;
